package main

import (
	"encoding/base64"
	"encoding/json"
	"fmt"
)

// 语言相关的SDK信息
// 新的JSON结构中，label和dev_team字段被放在了zh和en子对象中
type SDKLangInfo struct {
	Label   string `json:"label"`
	DevTeam string `json:"dev_team"`
}

// 新的ApkSDKJson结构体，适应新的JSON结构
type ApkSDKJson struct {
	Soname string       `json:"soname"`
	Zh     SDKLangInfo  `json:"zh"`
	En     SDKLangInfo  `json:"en,omitempty"` // omitempty表示如果没有en字段，序列化时会忽略
}

// 为了保持兼容性，定义一个函数来获取标签
func (sdk *ApkSDKJson) GetLabel() string {
	// 优先使用中文标签，没有则使用英文标签
	if sdk.Zh.Label != "" {
		return sdk.Zh.Label
	}
	return sdk.En.Label
}

// 为了保持兼容性，定义一个函数来获取团队名称
func (sdk *ApkSDKJson) GetTeam() string {
	// 优先使用中文团队名称，没有则使用英文团队名称
	if sdk.Zh.DevTeam != "" {
		return sdk.Zh.DevTeam
	}
	return sdk.En.DevTeam
}

func GetApkSDKMap() []ApkSDKJson {
	//base64编码后的json字符串
	apksdkdata := ""

	// 标准Base64解码
	apkpackbytes, err := base64.StdEncoding.DecodeString(apksdkdata)
	if err != nil {
		fmt.Println("base64解析失败:", err)
		return nil
	}

	// 解析JSON数据为map[string]interface{}
	var apkmap []ApkSDKJson
	err = json.Unmarshal(apkpackbytes, &apkmap)
	if err != nil {
		fmt.Println("JSON解析失败:", err)
		return nil
	}

	//测试输出 遍历map获取键/值
	//for _, value := range apkmap {
	//	fmt.Println("team:", value.Team)
	//	fmt.Println("Soname:", value.Soname)
	//}
	
	return apkmap
}
